export function add46(a: number, b: number): number {
  return a + b;
}

export function subtract46(a: number, b: number): number {
  return a - b;
}

export function multiply46(a: number, b: number): number {
  return a * b;
}

export function divide46(a: number, b: number): number {
  return a / b;
}
